@northblockyountville holds a special place in our hearts. It was our home away from home when we traveled from Chicago to Napa Valley, working on our #californiadream.
Five years ago, the restaurant was called Redd. Today, it’s The Restaurant at North Block. Inspired by the bounty of California but with a coastal influence, we were delighted by the layers of flavor and texture in every dish. 

I’m a sucker for great pasta - which you will find here - but the Spring in the Valley salad topped with dehydrated Kalamata olives was 👌🏾. So grateful for the opportunity to return to our old haunt to experience something new in Yountville. Between the food and the warm hospitality, we will be back again.
